pleText\":\"Southern Sotho\"}},{\"languageCode\":\"es\",\"languageName\":{\"simpleText\":\"Spanish\"}},{\"languageCode\":\"su\",\"languageName\":{\"simpleText\":\"Sundanese\"}},{\"languageCode\":\"sw\",\"languageName\":{\"simpleText\":\"Swahili\"}},{\"languageCode\":\"sv\",\"languageName\":{\"simpleText\":\"Swedish\"}},{\"languageCode\":\"tg\",\"languageName\":{\"simpleText\":\"Tajik\"}},{\"languageCode\":\"ta\",\"languageName\":{\"simpleText\":\"Tamil\"}},{\"languageCode\":\"tt\",\"languageName\":{\"simpleText\":\"Tatar\"}},{\"languageCode\":\"te\",\"languageName\":{\"simpleText\":\"Telugu\"}},{\"languageCode\":\"th\",\"languageName\":{\"simpleText\":\"Thai\"}},{\"languageCode\":\"tr\",\"languageName\":{\"simpleText\":\"Turkish\"}},{\"languageCode\":\"tk\",\"languageName\":{\"simpleText\":\"Turkmen\"}},{\"languageCode\":\"uk\",\"languageName\":{\"simpleText\":\"Ukrainian\"}},{\"languageCode\":\"ur\",\"languageName\":{\"simpleText\":\"Urdu\"}},{\"languageCode\":\"ug\",\"languageName\":{\"simpleText\":\"Uyghur\"}},{\"languageCode\":\"uz\",\"languageName\":{\"simpleText\":\"Uzbek\"}},{\"languageCode\":\"vi\",\"languageName\":{\"simpleText\":\"Vietnamese\"}},{\"languageCode\":\"cy\",\"languageName\":{\"simpleText\":\"Welsh\"}},{\"languageCode\":\"fy\",\"languageName\":{\"simpleText\":\"Western Frisian\"}},{\"languageCode\":\"xh\",\"languageName\":{\"simpleText\":\"Xhosa\"}},{\"languageCode\":\"yi\",\"languageName\":{\"simpleText\":\"Yiddish\"}},{\"languageCode\":\"yo\",\"languageName\":{\"simpleText\":\"Yoruba\"}},{\"languageCode\":\"zu\",\"languageName\":{\"simpleText\":\"Zulu\"}}],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"I5h8GfxIWVY\",\"title\":\"Holy Land: Startup Nations (Full Documentary) | Future Cities | WIRED\",\"lengthSeconds\":\"5361\",\"keywords\":[\"wired video\",\"wired magazine\",\"wired uk\",\"wired\",\"pop culture\",\"science\",\"politics\",\"conde nast\",\"health\",\"technology\",\"new technology\",\"robots\",\"robotics\",\"innovation\",\"Holy Land\",\"Future Cities\",\"Wired Cities\",\"Shenzhen\",\"Shenzhen Wired Cities\",\"Israel\",\"Silicon Valley\",\"Silicon Wadi\",\"Jerusalem\",\"Palestine\",\"West Bank\",\"Tel Aviv\",\"Ramallah\",\"Startup Nations\",\"Global Convergence\",\"Tech Startups\",\"MobilEye\",\"Entrepreneur\",\"Entrepreneurship\",\"Women in STEM\",\"STEM\",\"Infrastructure\",\"Urban Planning\",\"Self-Sustaining Cities\"],\"channelId\":\"UCWrXlzhIENTJrAuKVuPgdEA\",\"isOwnerViewing\":false,\"shortDescription\":\"With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs feature-length documentary looks beyond Tel Avivs vibrant, liberal tech epicenter to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Nazareth, Ramallah and other parts of the West Bank, as well as in the Israeli cybersecurity hub of Beer Sheva. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\\n\\nSubscribe to WIRED http:\/\/po.st\/SubscribeWired\\n\\nFUTURE CITIES | SERIES 2 - HOLY LAND:\\nThe second season of WIREDs Future Cities series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look beyond Tel Avivs vibrant, liberal tech epicentre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\\n\\nABOUT FUTURE CITIES\\nFuture Cities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\\n\\nFUTURE CITIES | SERIES 1 - SHENZHEN:\\nWe examine the unique manufacturing ecosystem that has emerged, gaining access to the worlds leading hardware-prototyping culture whilst challenging misconceptions from the west. The film looks at how the evolution of Shanzhai  or copycat manufacturing  has transformed traditional models of business, distribution and innovation, and asks what the rest of the world can learn from this so-called Silicon Valley of hardware\\\".\\n\\nCatch on the first series of Future Cities, Shenzhen: The Silicon Valley of Hardware, here: https:\/\/www.youtube.com\/watch?v=hp6F_ApUq-c\\u0026list=PLPoleY2BUvKc3kvmYOrjJsmRdho1qBDlR\\n\\nProduced by LUCA - www.luca.earth\\n\\nCONNECT WITH WIRED\\nWeb: http:\/\/po.st\/WiredVideo\\nTwitter: http:\/\/po.st\/TwitterWired\\nFacebook: http:\/\/po.st\/FacebookWired\\nGoogle+: http:\/\/po.st\/GoogleWired\\nInstagram: http:\/\/po.st\/InstagramWired\\nMagazine: http:\/\/po.st\/MagazineWired\\nNewsletter: http:\/\/po.st\/NewslettersWired\\n\\nABOUT WIRED\\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics.\\n\\nHoly Land: Startup Nations (Full Docmentary) | Future Cities | WIRED\\nhttps:\/\/www.youtube.com\/wireduk\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/I5h8GfxIWVY\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDvZk8nfk-0XI5MSkDe13ByUsgOsg\",\" , Israel has long been hailed as The Startup Nation. WIREDs feature-length documentary looks beyond Tel Avivs vibrant, liberal tech epicenter to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Nazareth, Ramallah and other parts of the West Bank, as well as in the Israeli cybersecurity hub of Beer Sheva. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nSubscribe to WIRED "},{"text":"http://po.st/SubscribeWired","navigationEndpoint":{"clickTrackingParams":"CJcBEM2rARgBIhMIk4LY1oqc6gIVDQbxBR2eDAZuSNayoeKfg5_MIw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=w-zEIu992Yg_2tm_lruge3AsFp98MTU5MzE0NDE3NkAxNTkzMDU3Nzc2\u0026event=video_description\u0026v=I5h8GfxIWVY\u0026q=http%3A%2F%2Fpo.st%2FSubscribeWired","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=w-zEIu992Yg_2tm_lruge3AsFp98MTU5MzE0NDE3NkAxNTkzMDU3Nzc2\u0026event=video_description\u0026v=I5h8GfxIWVY\u0026q=http%3A%2F%2Fpo.st%2FSubscribeWired","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nFUTURE CITIES | SERIES 2 - HOLY LAND:\nThe second season of WIREDs Future Cities series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look beyond Tel Avivs vibrant, liberal tech epicentre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nABOUT FUTURE CITIES\nFuture Cities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\n\nFUTURE CITIES | SERIES 1 - SHENZHEN:\nWe examine the unique manufacturing ecosystem that has emerged, gaining access to the worlds leading hardware-prototyping culture whilst challenging misconceptions from the west. The film looks at how the evolution of Shanzhai  or copycat manufacturing  has transformed traditional models of business, distribution and innovation, and asks what the rest of the world can learn from this so-called Silicon Valley of hardware\".\n\nCatch on the first series of Future Cities, Shenzhen: The Silicon Valley of Hardware, here: "},{"text":"https://www.youtube.com/watch?v=hp6F_...","navigationEndpoint":{"clickTrackingParams":"CJcBEM2rARgBIhMIk4LY1oqc6gIVDQbxBR2eDAZu","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=hp6F_ApUq-c\u0026list=PLPoleY2BUvKc3kvmYOrjJsmRdho1qBDlR","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"hp6F_ApUq-c","playlistId":"PLPoleY2BUvKc3kvmYOrjJsmRdho1qBDlR"}}},{"text":"\n\nProduced by LUCA - www.luca.earth\n\nCONNECT WITH WIRED\nWeb: "},{"text":"http://po.st/WiredVideo","navigationEndpoint":{"clickTrackingParams":"CJcBEM2rARgBIhMIk4LY1oqc6gIVDQbxBR2eDAZuSNayoeKfg5_MIw==","commandMetadata":{"webCommandMetadata":{"url":"/redirect?redir_token=w-zEIu992Yg_2tm_lruge3AsFp98MTU5MzE0NDE3NkAxNTkzMDU3Nzc2\u0026event=video_description\u0026v=I5h8GfxIWVY\u0026q=http%3A%2F%2Fpo.st%2FWiredVideo","rootVe":83769}},"urlEndpoint":{"url":"/redirect?redir_token=w-zEIu992Yg_2tm_lruge3AsFp98MTU5MzE0NDE3NkAxNTkzMDU3Nzc2\u0026event=video_description\u0026v=I5h8GfxIWVY\u0026q=http%3A%2F%2Fpo.st%2FWiredVideo","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\nTwitter: "},{" anguageName":{"simpleText":"Yiddish"}},{"languageCode":"yo","languageName":{"simpleText":"Yoruba"}},{"languageCode":"zu","languageName":{"simpleText":"Zulu"}}],"defaultAudioTrackIndex":0}},"videoDetails":{"videoId":"I5h8GfxIWVY","title":"Holy Land: Startup Nations (Full Documentary) | Future Cities | WIRED","lengthSeconds":"5361","keywords":["wired video","wired magazine","wired uk","wired","pop culture","science","politics","conde nast","health","technology","new technology","robots","robotics","innovation","Holy Land","Future Cities","Wired Cities","Shenzhen","Shenzhen Wired Cities","Israel","Silicon Valley","Silicon Wadi","Jerusalem","Palestine","West Bank","Tel Aviv","Ramallah","Startup Nations","Global Convergence","Tech Startups","MobilEye","Entrepreneur","Entrepreneurship","Women in STEM","STEM","Infrastructure","Urban Planning","Self-Sustaining Cities"],"channelId":"UCWrXlzhIENTJrAuKVuPgdEA","isOwnerViewing":false,"shortDescription":"With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs feature-length documentary looks beyond Tel Avivs vibrant, liberal tech epicenter to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Nazareth, Ramallah and other parts of the West Bank, as well as in the Israeli cybersecurity hub of Beer Sheva. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nSubscribe to WIRED http://po.st/SubscribeWired\n\nFUTURE CITIES | SERIES 2 - HOLY LAND:\nThe second season of WIREDs Future Cities series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look resdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/I5h8GfxIWVY","flashUrl":"http://www.youtube.com/v/I5h8GfxIWVY?version=3\u0026autohide=1","width":1280,"height":720,"flashSecureUrl":"https://www.youtube.com/v/I5h8GfxIWVY?version=3\u0026autohide=1"},"title":{"simpleText":"Holy Land: Startup Nations (Full Documentary) | Future Cities | WIRED"},"description":{"simpleText":"With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs feature-length documentary looks beyond Tel Avivs vibrant, liberal tech epicenter to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Nazareth, Ramallah and other parts of the West Bank, as well as in the Israeli cybersecurity hub of Beer Sheva. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nSubscribe to WIRED http://po.st/SubscribeWired\n\nFUTURE CITIES | SERIES 2 - HOLY LAND:\nThe second season of WIREDs Future Cities series takes us inside one of the worlds biggest startup nations. With the most tech startups and venture capital per capita in the world, Israel has long been hailed as The Startup Nation. WIREDs four-part series will look beyond Tel Avivs vibrant, liberal tech epicentre to the wider Holy Land region  the Palestinian territories, where a parallel Startup Nation story is emerging in East Jerusalem, Ramallah and the West Bank, as well as in the Israeli cybersecurity hub of Beersheba. And we will learn how the fertile innovation ecosystem of Silicon Wadi has evolved as a result of its unique political, geographical and cultural situation and explore the future challenges  and solutions  these nations are facing.\n\nABOUT FUTURE CITIES\nFuture Cities is part of a new flagship documentary strand from WIRED Video that explores the technologies, trends and ideas that are changing our world. Subscribe to the WIRED YouTube channel to ensure you never miss an episode.\n\nFUTURE CITIES | SERIES 1 - SHENZHEN:\nWe examine the unique manufacturing ecosystem that has emerged, gaining access to the worlds leading hardware-prototyping culture whilst challenging misconceptions from the west. The film looks at how the evolution of Shanzhai  or copycat manufacturing  has transformed traditional models of business, distribution and innovation, and asks what the rest of the world can learn from this so-called Silicon Valley of hardware\".\n\nCatch on the first series of Future Cities, Shenzhen: The Silicon Valley of Hardware, here: https://www.youtube.com/watch?v=hp6F_ApUq-c\u0026list=PLPoleY2BUvKc3kvmYOrjJsmRdho1qBDlR\n\nProduced by LUCA - www.luca.earth\n\nCONNECT WITH WIRED\nWeb: http://po.st/WiredVideo\nTwitter: http://po.st/TwitterWired\nFacebook: http://po.st/FacebookWired\nGoogle+: http://po.st/GoogleWired\nInstagram: http://po.st/InstagramWired\nMagazine: http://po.st/MagazineWired\nNewsletter: http://po.st/NewslettersWired\n\nABOUT WIRED\nWIRED brings you the future as it happens - the people, the trends, the big ideas that will change our lives. An award-winning printed monthly and online publication. WIRED is an agenda-setting magazine offering brain food on a wide range of topics, from science, technology and business to pop-culture and politics.\n\nHoly Land: Startup Nations (Full Docmentary) | Future Cities | WIRED\nhttps://www.youtube.com/wireduk"},"lengthSeconds":"5361","ownerProfileUrl":"http://www.youtube.com/user/WiredVideoUK","externalChannelId":"UCWrXlzhIENTJrAuKVuPgdEA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","C
